Photo by @amivitale // Wild elephants walk and browse on the 850,000-acre Namunyak Wildlife Conservancy. In the 1990's, elephants in this area had been poached to near extinction. Thanks to community based conservation, elephants have made an extraordinary comeback. Today there are more than 8700 elephants in the area, making it Kenya's second-largest population of elephants! It is truly amazing how resilient nature is when we give it a chance.

